svg.script:
		//Base element we're filling.
		var selector = "path";
		var canaryId = "path448";

		var viewBoxArray = [];

		//Speed of +/- sizing.
		var viewBoxIncrement = 3;

  		//Define the colors.
		var borderColor = "#2a2a2a;";
		var fillColors = ["#705540","#D6252E","#D68025","#FACF00","#DEDACA","#A3D000","#1E5F00","#3893E0","#2527D6","#8000FF","#E29A9F","#374049"]; 
		                //brown, red, orange, yellow, beige, lt green, dk green, blue, indigo, purple, pink, dk gray 
		var currentIdx = 7;

		function changeFill(evt) {
			//Click to change the color of a tile.
			var element = evt.target;
			if (element.getAttribute("fill") && element.getAttribute("fill") == fillColors[currentIdx]) {
				//Rotate the fill color.
				currentIdx = (currentIdx + 1) % fillColors.length;
			}
			setFillAndFilter(element,fillColors[currentIdx]);
			return;
		}		

		function initFill() {
			//Initialize the board with locations and seed terrain, then fill in the rest.

			//If the board isn't blank (saved user output), don't initialize.
			if (document.getElementById(canaryId).getAttribute("fill")) 
				return;

			var baseElt = document.querySelector("svg");
			var elts = baseElt.querySelectorAll(selector);
			for (j = 0; j < elts.length; j++) {
				randomFill(elts[j]);
			}
		}		

		function initListeners(baseElt) {
			var elts = baseElt.querySelectorAll(selector);
			for (var i = 0, length = elts.length; i < length; i++) {
				elts[i].addEventListener("click",changeFill, false);
			}

			//Init the viewbox.
			viewBoxArray = (baseElt.getAttribute("viewBox")).split(" ");
			viewBoxArray = viewBoxArray.map(function (dim) {return parseInt(dim,10);})

			baseElt.addEventListener("keypress",scaleViewBox);
		}

		function randomFill(element,colorArray) {
			//Fill in a tile at random from a provided color list (colorArray) or from the full color list.
			if (!colorArray || colorArray.length == 0) 
				colorArray = fillColors.slice(0);
			var index = Math.floor(colorArray.length*Math.random());
			setFillAndFilter(element,colorArray[index]);
		}

		function scaleViewBox(evt) {
			var charry = evt.keyCode;
			if (charry == 43) {
				//plus
				viewBoxArray[0] -= viewBoxIncrement;
				viewBoxArray[1] -= viewBoxIncrement;
				viewBoxArray[2] += 2 * viewBoxIncrement;
				viewBoxArray[3] += 2 * viewBoxIncrement;
			} else if (charry == 45 ) {
				//minus
				viewBoxArray[0] += viewBoxIncrement;
				viewBoxArray[1] += viewBoxIncrement;
				viewBoxArray[2] -= 2 * viewBoxIncrement;
				viewBoxArray[3] -= 2 * viewBoxIncrement;
			}

			var baseElt = document.querySelector("svg");
			baseElt.setAttribute("viewBox",viewBoxArray.join(" "));
		}

		function setFillAndFilter(element,color) {
			defaultColor = color;
			element.setAttribute("fill",color);
			element.setAttribute("stroke",borderColor);
		}

		//Onload.
		var baseElt = document.querySelector("svg");
		baseElt.addEventListener("load",function() {
			initFill();
			initListeners(baseElt);
		});
